description:
Quercus Technical Services traint elektrotechnisch en instrumentatiepersoneel op het gebied van explosieveiligheid. Dat doet Quercus op basis van ATEX richtlijnen (ATEX 95 en ATEX 137), de NEN EN IEC 60079 (NEN EN IEC 60079-10, NEN EN IEC 60079-14, NEN EN IEC 60079-17) en het Arbobesluit. Quercus maakt en houdt personeel competent, zodat zij hun werk veilig kunnen uitvoeren in gebieden met een verhoogd risico op gas- en stofexplosies. Denk daarbij aan het installeren en monteren van elektrisch materieel, onderhoud aan elektrotechnische installaties of elektrotechnische inspecties in explosieve atmosferen.

Elektro- en instrumentatiepersoneel houden wij competent door middel van CompEx trainingen. CompEx is dé wereldwijde oplossing voor het valideren en certificeren van kerncompetenties van personeel in de olie-, gas- en chemische sector. 

De Compex cursussen bestaan uit theorie en praktijk. En worden afgesloten met een examen en CompEx certificaat. Compex bestaat momenteel uit 12 modules en een opfristraining. Quercus biedt momenteel modules Ex 01 tot en met Ex 04 en de CompEx refresher (Ex 01R t/m Ex 04R):

• Ex-01 gericht op montage van Ex d, e, n en p apparatuur en componenten.
• Ex 02 gericht op inspectie en onderhoud van Ex d, e en n installaties.
• Ex 03 gericht op montage van Ex i apparatuur en componenten.
• Ex 04 gericht op inspectie en onderhoud van Ex i installaties.

De theorie over explosieveiligheid leren deelnemers klassikaal in één van onze vestigingen of op een locatie naar keuze. De theorie wordt ondersteund door praktijkvoorbeelden en demonstraties. In de theorie worden de volgende onderwerpen behandeld:

• Gasexplosiegevaar;
• LEL, UEL, ontstekingsenergie, relatieve dampdichtheid, vlampunt, ontstekingstemperatuur;
• Referentiegassen, ontstekingsbronnen;
• Classificatie van Ex gebieden;
• Categorieën apparatuur, IP klassen, beschermingswijzen;
• Markering van apparaten;
• ATEX 95, ATEX 137, normen, keuze apparatuur;
• Ex e apparatuur;
• Ex d apparatuur;
• Ex n apparatuur;
• Ex p apparatuur;
• Ex i apparatuur;
• Elektrische installaties en aarding;
• Veiligheidsprocedures;
• Onderhoud en inspectie aan Ex d, e en n materialen;
• Onderhoud en inspectie aan Ex i loops.

Tijdens de praktijkles voeren deelnemers onder begeleiding van een deskundige docent verschillende montage-, onderhoud- en inspectieopdrachten uit. Zo zijn deelnemers bezig met het afwerken van wartels, het lezen van IEC markeringen en het inspecteren van materiaal.

Ten slotte worden deelnemers getoetst aan de hand van een theorie- en praktijkexamen. Voldoen ze aan de gestelde criteria? Dan zijn de competenties up-to-date en ontvangen ze een mondiaal erkend Compex certificaat. 

Wij hebben wereldwijd een aantal vaste Compex trainingslocaties en beschikken over een mobiel CompEx practicum. Dit mobiele practicum is eenvoudig op- en af te bouwen en op elke locatie te plaatsen. De voordelen? Geen reis- en verblijfkosten,  continuïteit in het bedrijfsproces en flexibiliteit in data. 

Kies voor competentie en veiligheid. Kies voor de Compex trainingen van Quercus.

Voor meer informatie over Quercus of CompEx ga naar http://www.qts.nl, stuur een mail naar info@qts.nl of bel 038 - 452 99 91.
